import { colors, fonts } from "@/theme";
import React, { useState } from "react";
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  TextInput,
  ScrollView,
} from "react-native";
import Icon from "react-native-vector-icons/AntDesign";
import { useDispatch, useSelector } from "react-redux";
import { closeModal } from "@/redux/slices/modalSlice";

const AllocatedRequesCallback = () => {
  const dispatch = useDispatch();
  const isModalOpen = useSelector((state: any) => state.modal.isOpen); // Access modal state

  const handleCloseModal = () => {
    dispatch(closeModal()); // Dispatch action to close the modal
  };
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={handleCloseModal}>
          <Text style={styles.headerButton}>Close</Text>
        </TouchableOpacity>
        <Text style={styles.headerTitle}>Request Callback</Text>
        <TouchableOpacity>
          <Text style={styles.headerButton}>Reset</Text>
        </TouchableOpacity>
      </View>
      <View style={{ padding: 16 }}>
        <Text style={styles.heroTitle}>
          Need assistance or have any questions? Our team will give you a call
          back shortly.
        </Text>
      </View>
      <View style={{ padding: 16 }}>
        <View style={styles.types}>
          <View>
            <Text style={styles.typetitle}>Type</Text>
            <Text style={styles.typeText}>Allocated Units Inquiry</Text>
          </View>
          <View>
            <Icon name="down" color={colors.black} size={20} />
          </View>
        </View>

        <View style={styles.types}>
          <View>
            <Text style={styles.typetitle}>Callback Phone #</Text>
            <Text style={styles.typeText}>416-123-3533</Text>
          </View>
        </View>

        <View style={styles.typeMessage}>
          <View>
            <Text style={styles.typetitle}>Message</Text>
          </View>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // padding: 16,
    backgroundColor: colors.formBackground,
  },
  header: {
    paddingTop: 20,
    paddingHorizontal: 18,
    backgroundColor: colors.white,
    height: 60,
    flexDirection: "row",
    justifyContent: "space-between",
    // marginBottom: 16,
    marginTop: 0,
  },
  headerButton: {
    fontSize: 16,
    fontWeight: 400,
    lineHeight: 24,
    color: colors.primary,
    fontFamily: fonts.calibri.regular,
  },
  headerTitle: {
    fontSize: 16,
    fontWeight: 700,
    lineHeight: 24,
    color: colors.black,
    fontFamily: fonts.calibri.bold,
  },
  heroTitle: {
    fontSize: 16,
    fontWeight: 400,
    lineHeight: 24,
    color: colors.primaryBlue,
    fontFamily: fonts.calibri.regular,
  },
  types: {
    borderRadius: 8,
    paddingVertical: 8,
    paddingHorizontal: 16,
    borderWidth: 1,
    borderColor: colors.disablebutton,
    backgroundColor: colors.white,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 16,
  },
  typetitle: {
    fontSize: 14,
    fontWeight: 400,
    lineHeight: 24,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
    paddingBottom: 4,
  },
  typeText: {
    fontSize: 16,
    fontWeight: 400,
    lineHeight: 24,
    color: colors.primaryBlue,
    fontFamily: fonts.calibri.regular,
    paddingBottom: 4,
  },
  typeMessage: {
    borderRadius: 8,
    paddingVertical: 16,
    height: 200,
    paddingHorizontal: 16,
    borderWidth: 1,
    borderColor: colors.disablebutton,
    backgroundColor: colors.white,
    flexDirection: "row",
    justifyContent: "space-between",
    // alignItems: "center",
    marginBottom: 16,
  },
});

export default AllocatedRequesCallback;
